    false,nt"url": null,nt"notes": "This is a geo-referenced version of the
    PDF FIRM maps produced by FEMA and used to make determinations of floodplain status
    for the purposes of Flood Insurance. This is the same dataset used in the Floodpro
    tool found online through http://www.austintexas.gov/.  That tool uses Silverlight
    technology, as such, this interface is offered as an alternative visualization.
     Due to the complexity of these systems and the limitations of map accuracy and
    the relationship between the source data and the online basemap, these maps cannot
    serve as a functional replacement for consultations with FEMA staff, City staff.
    trained professional engineers, floodplain managers or flood insurance officials
    with professional  knowledge regarding flooding and the regulations related to flood
